import React from 'react'
import { Navbar, Nav } from 'react-bootstrap';
import ".NavBar.css"

function NavbarComponent() {
    return (
      <Navbar expand="lg" style={{ backgroundColor: "#A8DADC" }}>
        <Navbar.Brand>Stock Tracker</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className='justify-content-end'>
          <Nav className="mr-auto"></Nav>
          <Nav>
            <Nav.Link href="/search" activeClassName=".active">Search</Nav.Link>
            <Nav.Link href="/watchlist" activeClassName=".active">Wishlist</Nav.Link>
            <Nav.Link href="/portfolio" activeClassName=".active">Portfolio</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }


export default NavbarComponent;
